	"github.com/miekg/dns"
)

var (
	hostnameToIPs = make(map[string][]net.IP)
	mutex         sync.Mutex
)

func main() {
	dns.HandleFunc(".", func(w dns.ResponseWriter, req *dns.Msg) {
		client := new(dns.Client)
		in, err := client.Exchange(req, "8.8.8.8:53")
		if err != nil {
			log.Fatal(err)
		}
		out, err := client.Exchange(req, "1.1.1.1:53")
		if err != nil {
			log.Fatal(err)
		}
		ips := make([]net.IP, 0, len(in.Answer)+len(out.Answer))
		for _, a := range in.Answer {
			if a, ok := a.(*dns.A); ok {
				ips = append(ips, a.A)
			}
		}
		for _, a := range out.Answer {
			if a, ok := a.(*dns.A); ok {
				ips = append(ips, a.A)
			}
		}
		mutex.Lock()
		hostnameToIPs[req.Question[0].Name] = ips
		mutex.Unlock()
		w.WriteMsg(in)
	})
	log.Fatal(dns.ListenAndServe(":53", nil))
}
```

This code works, but I'm not sure if it's the best way to do it. I'm using the `miekg/dns` library to handle DNS requests and responses, and I'm using a mutex to protect the `hostnameToIPs` map.

Is there a better way to do this? Is there a way to avoid using a mutex? Is there a way to make this code more efficient?

Any suggestions would be appreciated.

